import React from 'react';
import GoogleMaps from 'simple-react-google-maps';
import ContactForm from '../../components/form/contact-form.component';
import { ContactContainer, InfoWrapper } from './contact.styles';

const ContactPage = () => {
	return (
		<div className="main">
			<ContactContainer>
				<InfoWrapper>Kontaktdaten</InfoWrapper>
				<ContactForm style={{ width: '100%' }} />
			</ContactContainer>
			<GoogleMaps
				apiKey={'AIzaSyCOKB07tfeRagR_mNBJDsoipg5gMnBqW4s'}
				style={{ height: '400px', width: '800px' }}
				zoom={17}
				center={{ lat: 52.816940262322035, lng: 13.331603113813927 }}
				// markers={{ lat: 52.816640262322035, lng: 13.331743113813927 }}
			/>
		</div>
	);
};

export default ContactPage;
